import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

}
<div class="container bg-warning p-3">

  <section class="container text-center mt-4">
    <img class="col-5" src="/assets/home-tech.png" alt="">
    <h3>Welcome to my Project.</h3>
  </section>

  <div class="d-grid col-md-12 col-lg-8 mx-auto mt-5">
    <button type="button" routerLink="../menu" class="btn btn-light border-danger btn-lg text-center">
      <i class="fa-solid fa-bars"></i></button>
  </div>

</div>
